import React, { useEffect, useState } from "react";
import "../Style/homeStyle.css";

const Header = () => {
  return (
    <header>
      <div className="logo">Logo</div>
      <nav>
        <ul>
          <li>
            <a href="#">Početna</a>
          </li>
          <li>
            <a href="#">Omiljeni tabovi</a>
          </li>
          <li>
            <a href="#">Arhiva tabova</a>
          </li>
          <li>
            <a href="#">Profil</a>
          </li>
          <li>
            <a href="#">Postavke</a>
          </li>
          <li>
            <a href="#">Novosti</a>
          </li>
        </ul>
      </nav>
    </header>
  );
};

const Card = ({ title, artist, album }) => {
  return (
    <div className="card">
      <div className="card-image">Slika albuma</div>
      <div className="card-content">
        <h2>{title}</h2>
        <p>{artist}</p>
        <p>{album}</p>
      </div>
    </div>
  );
};

const RecommendedTabs = () => {
  const [recommendedTabs, setRecommendedTabs] = useState([]);

  useEffect(() => {
    // Fetch song data from the backend
    fetch("/api/songs")
      .then((response) => response.json())
      .then((data) => setRecommendedTabs(data))
      .catch((error) => console.error(error));
  }, []);

  return (
    <section className="recommended-tabs">
      <h2>Preporučeni tabovi</h2>
      <div className="card-container">
        {recommendedTabs.map((tab, index) => (
          <Card
            key={index}
            title={tab.title}
            artist={tab.artist}
            album={tab.album}
          />
        ))}
      </div>
    </section>
  );
};

const Footer = () => {
  return (
    <footer>
      <p>© 2023 TabTracker. Sva prava pridržana.</p>
      <p>
        <a href="#">Uvjeti korištenja</a> | <a href="#">Pravila privatnosti</a>{" "}
        | <a href="#">Kontakt</a> | <a href="#">O nama</a>
      </p>
    </footer>
  );
};

const Home = () => {
  return (
    <div className="Home">
      <Header />
      <section className="main-content">
        <h1>TabTracker</h1>
        <div className="card-container">
          <Card title="Pjesma 1" artist="Izvođač 1" album="Album 1" />
          <Card title="Pjesma 2" artist="Izvođač 2" album="Album 2" />
          <Card title="Pjesma 3" artist="Izvođač 3" album="Album 3" />
          <Card title="Pjesma 4" artist="Izvođač 4" album="Album 4" />
          <Card title="Pjesma 5" artist="Izvođač 5" album="Album 5" />
          {/* Dodajte više kartica ovisno o potrebama */}
        </div>
        <RecommendedTabs />
      </section>
      <Footer />
    </div>
  );
};

export default Home;
